export default function About() {
  return (
    <section className="max-w-4xl mx-auto py-20 px-4">
      <h2 className="text-3xl font-bold mb-6">About Me</h2>
      <p className="text-gray-700 mb-4">
        I'm a creative developer with a passion for building clean, functional, and user-centric websites. I specialize in modern JavaScript, React, and responsive design.
      </p>
      <p className="text-gray-700">
        With a background in both design and code, I love translating ideas into interfaces that feel intuitive and engaging.
      </p>
    </section>
  );
}
